import React from "react";
import { Link } from "react-router-dom";
import { useEffect, useState } from "react";

function CreateUser() {

    const [name, setName] = useState("");
    const [email, setEmail] = useState("");
    const [passwordOne, setpasswordOne] = useState("");
    const [passwordTwo, setPasswordTwo] = useState("");


    useEffect(() => {

        console.log(name,email,passwordOne,passwordTwo);

    }, [name,email,passwordOne,passwordTwo])


    return (

        <div className="home-right-con">

            <div className="content-home-right ">

                <h1 className="bold-light">Take 10% off today.</h1>

                <form className="form-login" >

                    <label className="label-Inputs bold-light" htmlFor="email">Name and Lastname</label>
                    <input className="login-input" type="text" onChange={(e) => { setName(e.target.value) }} placeholder="your name" required="required" />

                    <label className="label-Inputs bold-light mt-24" htmlFor="email">Email</label>
                    <input className="login-input" type="text" onChange={(e) => { setEmail(e.target.value) }} placeholder="Youremail@address.com" required="required" />

                    <div className="">

                        <label className="label-Inputs bold-light mt-24 r-label " htmlFor="email">Password</label>
                        <label className="label-Inputs bold-light mt-24 ml-40px" htmlFor="email">Password again</label>

                    </div>

                    <div className="display-flex">
                        <input onChange={(e) => { setpasswordOne(e.target.value) }} className="register-input " type="password" placeholder="Your password" required="required" />
                        <input onChange={(e) => { setPasswordTwo(e.target.value) }} className="register-input  register-input-right" type="password" placeholder="Your password" required="required" />
                    </div>

                    <button type="submit" className="btn btn-primary w-100 btn-login">Register</button>
                </form>

                <div className="p-after-bttn">
                    <p>
                        <span className="textafterlogin">Already have an account </span>
                        <Link className="bold-light href" to="/user/login">Log In</Link>
                    </p>
                </div>
            </div>
        </div>

    );


}

export default CreateUser;
